import { useEffect, useState } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import Header from '../components/Header';
import Footer from '../components/Footer';

export default function HasilNegatif() {
  const location = useLocation();
  const navigate = useNavigate();

  const {
    nama = 'Nama Tidak Diketahui',
    hasil = 'Negatif',
    probabilitas = 0.0,
    identitas,
    gejala,
    tanggal,
  } = location.state || {};

  const [submitStatus, setSubmitStatus] = useState('pending');
  const [hasSubmitted, setHasSubmitted] = useState(false);

  const tanggalScreening = tanggal || new Date().toISOString();
  const tanggalFormatted = new Date(tanggalScreening).toLocaleDateString('id-ID', {
    day: '2-digit',
    month: 'long',
    year: 'numeric',
  });

  useEffect(() => {
    if (submitStatus === 'pending' && !hasSubmitted) {
      setHasSubmitted(true); // âœ… Cegah submit dobel

      const simpanData = async () => {
        if (!identitas || !gejala) {
          console.warn('âš ï¸ Data identitas atau gejala tidak tersedia.');
          return;
        }

        try {
          const userRaw = localStorage.getItem('user');
          const user = JSON.parse(userRaw);

          if (!user || !user.user_id) {
            alert('Anda belum login. Silakan login terlebih dahulu.');
            navigate('/login');
            return;
          }

          const response = await fetch('http://localhost:5000/submit-screening', {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify({
              user_id: parseInt(user.user_id),
              nama_pasien: identitas.nama,
              nik: identitas.nik,
              jenis_kelamin: identitas.jenisKelamin,
              no_hp: identitas.telepon,
              usia: identitas.usia,
              alamat: identitas.alamat,
              hasil: hasil,
              catatan: '',
              probabilitas: parseFloat(probabilitas),
              gejala,
            }),
          });

          if (!response.ok) throw new Error('Gagal menyimpan data ke backend.');

          setSubmitStatus('success');
          console.log('âœ… Data screening berhasil disimpan.');
        } catch (error) {
          console.error('ðŸ”¥ Gagal menyimpan data:', error);
          setSubmitStatus('error');
        }
      };

      simpanData();
    }
  }, [submitStatus, hasSubmitted, gejala, identitas, hasil, probabilitas, navigate]);

  const handleKembali = () => {
    navigate('/mainmenu');
  };

  return (
    <div className="d-flex flex-column min-vh-100">
      <Header />

      <div className="container my-5 flex-grow-1 text-center">
        <h2 className="fw-bold text-success">SCREENING TBC</h2>
        <p className="text-muted">
          Berdasarkan jawaban Anda, Anda tidak terindikasi TBC.
        </p>

        <div
          className="card mx-auto p-4"
          style={{ maxWidth: '500px', backgroundColor: '#e8f5e9' }}
        >
          <img
            src="/assets/images/Sehat.png"
            alt="Sehat"
            className="img-fluid mb-3"
            style={{ maxWidth: 140 }}
          />

          <div className="bg-white shadow-sm rounded p-3 mb-3">
            <h5 className="mb-1 fw-bold">{nama}</h5>
            <small className="text-muted">{tanggalFormatted}</small>
          </div>

          <h5 className="text-success fw-bold mb-2">Anda Tidak Terduga TBC</h5>
          <p className="mb-0">
            Probabilitas: {(parseFloat(probabilitas) * 100).toFixed(2)}%
          </p>

          {submitStatus === 'error' && (
            <div className="alert alert-danger mt-3">
              Gagal menyimpan data screening. Silakan coba lagi nanti.
            </div>
          )}
        </div>

        <p className="mt-4 text-muted">
          Tetap jaga kesehatan dan lakukan pola hidup bersih dan sehat.
        </p>

        <div className="d-grid gap-3 mt-4 col-10 col-md-6 mx-auto">
          <button className="btn btn-outline-secondary" onClick={handleKembali}>
            Kembali ke Halaman Awal
          </button>
        </div>
      </div>

      <Footer />
    </div>
  );
}
